import React from 'react';

const TheProject = () => {
  return (
    <div>
      <h1>The Project</h1>
      <p>This page contains information about the project. For more details, visit the Medium article:</p>
      <a href="https://medium.com/@tianhe1019/a-digital-initiative-for-the-visually-impaired-in-new-york-3d405de5a4e5" target="_blank" rel="noopener noreferrer">
        Read the Medium article
      </a>
    </div>
  );
}

export default TheProject;
